arr.sort((a, b) => {
  if (a < b) return -1;
  if (a > b) return 1;
  return 0;
});

console.log(arr); // ['Apple', 'Cherry', 'avocado', 'banana']
```

In this case, the sorting function will consider 'A' and 'a' as different characters, resulting in a case-sensitive sort.

