Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = spark.read()
      .textFile("onsite_data.txt")
      .javaRDD()

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.read()
      .textFile("top_queries.txt")
      .javaRDD()

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache: Map[String, Long] = mutable.Map()

    // Process onsite data
    val hitRate = onsiteData.map(new Function[String, (String, Boolean)] {
      override def call(line: String): (String, Boolean) = {
        val Array(query, timestamp) = line.split(" ")

        // Check if query is in top queries
        if (broadcastTopQueries.value.contains(query)) {
          // Check if query is in cache
          if (cache.contains(query)) {
            // Check if query is still in cache
            if (cache(query) > System.currentTimeMillis()) {
              // Cache hit
              (query, true)
            } else {
              // Cache miss, update cache
              cache.put(query, System.currentTimeMillis() + 12 * 60 * 60 * 1000)
              (query, false)
            }
          } else {
            // Cache miss, update cache
            cache.put(query, System.currentTimeMillis() + 12 * 60 * 60 * 1000)
            (query, false)
          }
        } else {
          // Query not in top queries, ignore
          (query, false)
        }
      }
    }).filter(_._2).count() / onsiteData.count().toDouble

    println(s"Hit rate: $hitRate")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from text files. It then broadcasts the top frequent queries to all nodes in the cluster. It initializes a cache to store the queries and their expiration times.

The job then processes each line in the onsite attributed data. It checks if the query is in the top frequent queries and if it is in the cache. If it is in the cache and the cache has not expired, it is a cache hit. If it is not in the cache or the cache has expired, it is a cache miss and the cache is updated with the new query and its expiration time.

Finally, the job calculates the hit rate by dividing the number of cache hits by the total number of queries in the onsite attributed data.

